import React from 'react'
import { Link } from 'react-router-dom'


const Profile = () => {
  return (
    <div className='d-flex'>
      <h3>Profile</h3>
      <Link to='/userTasks'><button className='btn btn-success ms-3 mb-2'>UserTasks</button></Link>
    </div>
  )
}

export default Profile
